import React, {Component} from 'react';
import FlightComponent from "../reusable_components/FlightComponent";
import AircraftServices from "../services/AircraftServices";

class TestMainPage extends Component {

    constructor(props) {
        super(props);

        this.state = {
            aircraftDropdown: []
        }

    }


    getAllData = () => {
        AircraftServices.getAllAircraft().then((response => {
            console.log(response.data);
            this.setState({aircraftDropdown: response.data})
        }))
    }

    render() {
        return (
            <div>
                {
                    this.getAllData()
                }
                <FlightComponent
                    aircraftDropdown={this.state.aircraftDropdown}
                />
            </div>
        );
    }
}

export default TestMainPage;
